import React, { Component } from 'react';

export default class AddProject extends Component {
    constructor(props){
        super(props);
        this.state = {
            name: '',
            tech: '',
            link: ''
        }
    }

    onChange = (e) => {
        var target = e.target;

        if ( target.name === 'name' ){
            this.setState({ name: target.value })
        }
        if ( target.name === 'tech' ){
            this.setState({ tech: target.value})
        }
        if ( target.name === 'link' ){
            this.setState({ link: target.value})
        }
    }


    render() {
        console.log(this.state);
        return (
            <div className="primary col-8">
                <form>
                    <div className="form-group rounded">
                        <label htmlFor="name" value="name">Name</label>
                        <input onChange={this.onChange} className="form-control" type="text" name="name" id="project-name" />
                    </div>
                    <div className="form-group rounded">
                        <label htmlFor="tech" value="tech">Tech</label>
                        <input className="form-control" type="text" name="tech" id="project-tech" />
                    </div>
                    <div className="form-group rounded">
                        <label htmlFor="link" value="link">Link</label>
                        <input className="form-control" type="text" name="link" id="project-link" />
                    </div>
                    <div className="form-group rounded text-right" id="btn-control">
                        <input className="btn btn-primary" type="submit" value="Add Project" id="project-submit" />
                    </div>
                </form>
            </div>
        );
    }
}
